let interactiveLines3=!1;function next_interactive_lines_v3(){if(interactiveLines3){return}
var isBricks=window.location.href.includes("brickspreview");document.querySelectorAll('.nb-interactive-lines-v3').forEach(container=>{if(isBricks&&container.getAttribute('data-disable-builder')==='1'){return}
var magnetContainer=container.querySelector(".nb-interactive-lines-v3__magnet");const rows=parseFloat(container.getAttribute("data-rows"));const columns=parseFloat(container.getAttribute("data-columns"));magnetContainer.style.gridTemplateRows=`repeat(${rows}, 1fr)`;magnetContainer.style.gridTemplateColumns=`repeat(${columns}, 1fr)`;const total=rows*columns;for(let i=0;i<total;i++){const span=document.createElement("span");magnetContainer.appendChild(span)}
function updateRotation(pointer){document.querySelectorAll(".nb-interactive-lines-v3__magnet span").forEach((item)=>{const rect=item.getBoundingClientRect();const centerX=rect.x+rect.width/2;const centerY=rect.y+rect.height/2;const dx=pointer.x-centerX;const dy=pointer.y-centerY;const dist=Math.sqrt(dx*dx+dy*dy)||1;const angle=((Math.acos(dx/dist)*180)/Math.PI)*(pointer.y>centerY?1:-1);item.style.setProperty("--rotate",`${angle}deg`)})}
window.addEventListener("pointermove",(e)=>{updateRotation({x:e.clientX,y:e.clientY})});setTimeout(()=>{const items=document.querySelectorAll(".nb-interactive-lines-v3__magnet span");const middle=items[Math.floor(items.length/2)].getBoundingClientRect();updateRotation({x:middle.x,y:middle.y})},300)});interactiveLines3=!0}
document.addEventListener("DOMContentLoaded",function(t){bricksIsFrontend&&next_interactive_lines_v3()})